import React from 'react';
import styled from 'styled-components'

const Background = styled.div`
    display: flex;
    position: fixed;
    flex-direction: row;
    background-color: #ACBCD2;
    height: 20px;
    padding: 10px;
    width: 100%;
    z-index: 5;
`

function ToolBar() {
    return(
        <>
        <Background>
            <div>About</div>
            <div>Work</div>
            <div>Contact</div>
            <div>Reviews</div>
        </Background>
        </>
    )
}

export default ToolBar;
